		clear: none;
		border: 0;
		margin: 0;
		visibility: visible;
		display: block; //override for bootrap collapse
	}
}

// wrapper to apply padding for the collapse element to animate correctly see
// https://github.com/twbs/bootstrap/issues/12093
.list-header-filters-wrapper {
	padding: $sc-padding-lv4 $sc-padding-lv2;
