// Pagination
//
// Pagination is used to navigate between lists of products or records.
// Pagination is generally accompanied by a results counter.
//
// Markup:
// <nav>
//   <p class="pagination-count">1-12 of 37 results</p>
//   <ul class="pagination-links">
//     <li class="pagination-prev">
//       <a href="#">
//         <i class="icon-chevron-left"></i>
//       </a>
//     </li>
//     <li><a href="#">1</a></li>
//     <li><a class="pagination-active" href="#">2</a></li>
//     <li><a href="#">3</a></li>
//     <li><a href="#">...</a></li>
//     <li><a href="#">9</a></li>
//     <li><a href="#">10</a></li>
//     <li class="pagination-next">
//       <a href="#">
//         <i class="icon-chevron-right"></i>
//       </a>
//     </li>
//   </ul>
// </nav>
//
// Styleguide 3.6

.pagination-links {
  @extend .clearfix;
  float: right;
  width: 50%;
  text-align: right;
  padding: $sc-padding-lv1 0;

  @media (min-width: $screen-sm-min) {
    float: none;
    width: 100%;
    display: flex;
    justify-content: center;
  }

  li {
    //float: left;
    height: auto;
    width: auto;
    text-align: center;
  }

  a {
    display: block;
    text-decoration: none;
    padding: $sc-padding-lv2 $sc-padding-lv2 + 1;
    height: auto;
    line-height: 1.3;
  }
}

.pagination-count {
  float: left;
  width: 50%;
  text-align: right;

  @media (min-width: $screen-sm-min) {
    float: none;
    width: auto;
    text-align: center;
  }
}

.pagination-links-number {
  display: none;
  background-color: transparent;

  @media (min-width: $screen-md-min) {
    display: block;
  }
}

.pagination-prev,
.pagination-next {
  color: $sc-color-copy;
  background-color: transparent;

  a:hover {
    background-color: transparent;
  }
}

.pagination-prev,
.pagination-next,
.pagination-next-disabled {
  margin-left: $sc-margin-lv1;

  @media (min-width: $screen-md-min) {
    margin-left: 0;
  }
}

.pagination-disabled,
.pagination-prev-disabled,
.pagination-next-disabled {
  display: none;
}

.pagination-active {
  color: $sc-color-theme-content-background;
  cursor: default;
  font-size: $sc-font-size-xl;
  background: $sc-color-tertiary;

  &:hover {
    color: $sc-color-copy;
  }
}

// Push pane
//
// A push pane is used for presenting complementary information within the context of a page.
// Push panes are used specifically in small screen devices. This type of pane is always triggered by the user when a push button is tapped.
// Push panes slide from right to left using a push animation.
//
// It's not required HTML markup to build a Push Pane, this component has to be invoked from a Backbone.View.
// To do that, it's necesary execute "this.application.getLayout().showInPush(view)", where "view" parameter
// is the content which you want to show.
//
// Styleguide 3.10

$sc-pusher-width-xs: 100%;
$sc-pusher-width-md: 472px;

.sc-pushing {
    position: relative;
}

// mobile only
[data-pusher="sc-pushable-xs"]{
    width: $sc-pusher-width-xs;
    right: -$sc-pusher-width-xs;
    background: $sc-neutral-shade-0;
    display: none;

    @include transition-transform(400ms ease);

    &.sc-pushing-reopened {
        transition: none;
    }

    height: 100%;
    position: fixed;
    top: 0;
    z-index: 10000;
    padding-left: $sc-padding-lv4;
    padding-right: $sc-padding-lv4;
    padding-bottom: $sc-padding-lv8;

    .sc-pusher-header {
        margin-left: -$sc-margin-lv4;
        margin-right: -$sc-margin-lv4;
        @media (min-width: $screen-sm-min) {
            display: none;
        }
    }
    @extend %scroll-y;
    @media (min-width: $screen-sm-min) {
        width: auto;
        height: auto;
        position: static;
        padding-left: 0;
        padding-right: 0;
        background: none;
        display: block;
    }
}

// both tablet and mobile
[data-pusher="sc-pushable-md"]{
    width: $sc-pusher-width-xs;
    right: -$sc-pusher-width-xs;
    background: $sc-neutral-shade-0;

    @include transition-transform(400ms ease);

    &.sc-pushing-reopened {
        transition: none;
    }

    height: 100%;
    position: fixed;
    top: 0;
    z-index: 10000;
    padding-left: $sc-padding-lv4;

    .sc-pusher-header {
        margin-left: -$sc-margin-lv4;
        @media (min-width: $screen-md-min) {
            display: none;
        }
    }

    @media (min-width: $screen-sm-min) {
        width: $sc-pusher-width-md;
        right: -$sc-pusher-width-md;
    }
    @extend %scroll-y;
    @media (min-width: $screen-md-min) {
        width: auto;
        height: auto;
        position: static;
        padding-left: 0;
    }
}

[data-pusher="sc-pushable-xs"][data-action="sc-pushing"]{
    @include translate3d(-$sc-pusher-width-xs, 0, 0);
    @media (min-width: $screen-sm-min){
        transform: none;
    }
    display: block;
}

[data-pusher="sc-pushable-md"][data-action="sc-pushing"]{
    @media (min-width: $screen-sm-min){
        @include translate3d(-$sc-pusher-width-md, 0, 0);
    }
    @include translate3d(-$sc-pusher-width-xs, 0, 0);
    @media (min-width: $screen-md-min){
        transform: none;
    }
}

$sc-push-header-height: 69px;

.sc-pusher-header {
    background: $sc-color-theme-background;
    border-bottom: 1px solid $sc-color-theme-border-light;;
    margin-bottom: $sc-margin-lv4;
    height: $sc-push-header-height;
}

.sc-pusher-header-back {
    color: $sc-color-link;
    text-transform: capitalize;
    display: inline-block;
    width:50%;
    line-height: $sc-push-header-height;
    padding-left: $sc-padding-lv2;
}
.sc-pusher-header-back::before {
    @extend .icon-chevron-left;
    margin-right: $sc-margin-lv2;
}

.sc-pushing-partial {
    overflow-y: hidden;
}

.main-push-overlay {

    display: none;

    @media (min-width: $screen-sm-min) and (max-width: $screen-sm-max) {
        height: 100%;
        width: 100%;
        position: fixed;
        z-index: 99;
        top: 0;
        left: 0;

        &.active {
            display: block;
        }
    }
}

// Quantity input
//
// Some of the molecules listed on this styleguide are responsive and change their behaviour according to the device or browser width.
// This is one of those, so, you might change the width of your browser window and see the molecule change its behaviour.
//
// Markup:
// <div class="quantity-input-container">
//   <button class="quantity-input-button-remove">-</button>
//   <input type="number" name="quantity" class="quantity-input" value="1" min="1" />
//   <button class="quantity-input-button-add">+</button>
// </div>
//
// Styleguide 3.11

.quantity-input-container {
	display: block;
}

input[type="text"].quantity-input,
input[type="number"].quantity-input {
 	width: 62px;
 	height: 42px;
 	text-align: right;
 	padding: $sc-margin-lv2;
	background-color: $sc-color-body-background;
	//float: left;
	display: inline-block;
	vertical-align: bottom;
	margin: 0 0 0 0;
    border: 1px solid $sc-color-theme-border;

	@media (min-width: $screen-md-min) {
		display: inline-block;
		background: white;
		float: none;
	}
}

.quantity-input-button {
	background-color: $sc-color-theme-300;
	color: $sc-color-theme-700;
	border: 1px solid $sc-color-theme-300;
	width: 42px;
	height: 42px;
	float: none;
	display: inline-block;

	&:hover, &:active  {
		background-color: $sc-color-theme-500;
	}

	&:focus {
		outline: none;
	}

	@media (min-width: $screen-md-min) {
		display: inline-block;
	}
}

.quantity-input-button-add {
	@extend .quantity-input-button;
	border-radius: 0 $sc-border-radius $sc-border-radius 0;
}

.quantity-input-button-remove {
	@extend .quantity-input-button;
	border-radius: $sc-border-radius 0 0 $sc-border-radius;
}

//Search Content dropdown
.nav-search {
  width: 100%;
  //border-bottom: 1px solid $sc-color-theme-border-light;
  //border-top: 1px solid $sc-color-theme-border-light;

  @media (min-width: $screen-md-min) {
    padding: $sc-padding-lv2 0;
    border: 0;
  }
}

.nav-search-content {
  @extend .container;
  border: 1px solid $sc-color-theme-border-light;
  clear: both;
  height: 50px;
  margin-top: 0;
  margin-bottom: 0;
  padding: 0;
  position: relative;

  @media (min-width: $screen-md-min) {
    height: auto;
    display: flex;
  }

  .site-search-content-form {
    @media (min-width: $screen-md-min) {
      width: 95%;
    }
  }
}

//Search Content form
.nav-search-content-input {
  width: 100%;
  float: left;
  position: relative;
}

.nav-search-content-input span {
  width: 100%;
}

.nav-search-input-icon {
  position: absolute;
  top: 12px;
  font-size: $sc-font-size-xl;
  left: 10px;
  color: $sc-neutral-shade-300;
  z-index: 99;

  @extend .fa;
  @extend %fa-search;
}

input.nav-search-input {
  padding: $sc-padding-lv3 0 $sc-padding-lv3 $sc-padding-lv4;
  height: 20px;
  box-shadow: none;
  margin: 0;
  width: calc(80% - #{$sc-padding-lv8});
  width: expression(80% - #{$sc-padding-lv8}); /* IE-OLD */
  -webkit-tap-highlight-color: transparentize($sc-neutral-shade-500, 1);
  background: transparent;

  @media (min-width: $screen-md-min) {
    padding-left: $sc-padding-lv8;
    width: calc(100% - #{$sc-padding-lv1 * 18});
    width: expression(100% - #{$sc-padding-lv1 * 18}); /* IE-OLD */
  }
}

.nav-search-input-reset {
  display: none;
  position: absolute;
  top: 0px;
  right: 20%;
  width: 50px;
  height: 50px;
  cursor: pointer;
  font-size: $sc-font-size-m;
  padding: $sc-padding-lv2 $sc-padding-lv3;

  @media (min-width: $screen-md-min) {
    right: 50px;
  }

  &-icon {
    @extend .fa;
    @extend %fa-times-circle;
    color: $sc-color-theme-500;
    font-size: $sc-font-size-l;
  }
}

.nav-search-button-submit {
  border-radius: 0px;
  border: 0px;
  background: $sc-color-theme-700;
  color: $sc-neutral-shade-0;
  padding: 0 $sc-padding-lv2;
  float: right;
  visibility: hidden;
  position: absolute;
  top: 0;
  right: 0;
  line-height: 100%;
  height: 100%;

  @media (min-width: $screen-md-min) {
    visibility: visible;
  }

  &:hover, &:focus {
    background: $sc-button-secondary-hover-background-color;
    color: $sc-neutral-shade-0;
  }
}

//Serach Button close toggle
.nav-search-button-close {
  border-radius: 0px;
  border: 0px;
  background: $sc-color-theme-background;
  color: $sc-color-theme-700;
  border-left: 1px solid $sc-color-theme-border-light;
  height: 50px;
  width: 20%;
  float: right;
  text-align: center;
  line-height: 47px;
  display: block;
  position: absolute;
  top: 0;
  right: 20%;
  border: none;

  @media (min-width: 992px) {
    display: none;
  }
}

//Typeahead plugin
.tt-menu {
  width: 100%;
  background: $sc-color-theme-content-background;
  margin-top: -1px;
  border: 1px solid transparentize($sc-color-theme-700, 1-0.3);
  border-top: 0;
  box-shadow: 0 8px 12px transparentize($sc-neutral-shade-500, 1-0.175);
  -webkit-box-shadow: 0 8px 12px transparentize($sc-neutral-shade-500, 1-0.175);
  overflow: hidden;

  @media (min-width: $screen-md-min) {
    margin-top: 0;
  }
}

.tt-menu-shadow-fix {
  @include box-shadow(inset 0px 4px 6px -6px $sc-color-theme-700);
  height: 3px;
}

.tt-suggestions {
  cursor: pointer;
  cursor: hand;
  padding: 0;
  font-size: $sc-font-size-s;
}

.itemssearcher-input.tt-hint {
  color: $sc-color-copy-light;
}

//Typeahead headers
.all-results {
  display: block;
  border-bottom: 1px solid $sc-color-theme-border-light;
  color: $sc-color-link;
  font-size: $sc-font-size-m;
  padding: $sc-margin-lv4 $sc-margin-lv7 $sc-padding-lv4 $sc-margin-lv7;
  text-transform: uppercase;

  &:hover {
    color: $sc-color-link-hover;
    text-decoration: underline;
  }

  @media screen and (max-width: $screen-sm-max) {
    padding: $sc-margin-lv3 $sc-margin-lv5 $sc-padding-lv3 $sc-margin-lv5;
  }
}

.no-results {
  @extend .all-results;
  border-bottom: 0;
  color: $sc-color-copy;

  &:hover {
    text-decoration: none;
    color: $sc-color-copy;
  }
}

.searching {
  @extend .no-results;
  color: $sc-color-copy;
}

//Typeahead Item
.item-results {
  padding: $sc-padding-lv3 0;
  cursor: pointer;
  display: block;
  @extend .clearfix;

  &:hover {
    background: $sc-color-theme-background;
  }
}

.tt-cursor {
  background: $sc-color-theme-background;
}

.item-results-image {
  width: 25%;
  float: left;
  display: block;
  text-align: center;
  padding-left: $sc-padding-lv7;

  img {
    @media screen and (max-width: $screen-sm-max) {
      max-width: 100px;
      padding-left: $sc-padding-lv5;
    }
    @media screen and (max-width: $screen-xs-max) {
      max-width: 80px;
      width: 20%;
      padding-left: $sc-padding-lv4;
    }
  }

  @media (min-width: $screen-sm-min) {
    display: block;
  }
}

.item-results-content {
  width: 75%;
  float: left;
  padding: $sc-padding-lv2 $sc-padding-lv4 0;

  @media (min-width: $screen-sm-min) {
    padding: $sc-padding-lv2 $sc-padding-lv3 0;
  }

  .global-views-star-rating {
    display: none;
    @media (min-width: $screen-sm-min) {
      display: block;
    }
  }
}

.item-results-title {
  margin-bottom: $sc-margin-lv1;
  display: block;
  font-size: $sc-font-size-m;
}

.tt-highlight {
  font-weight: $sc-font-weight-semibold;
  color: $sc-color-primary;
}

.item-results:hover .item-results-title {
  color: $sc-color-link;
}

.item-results-rate {
  display: none;
  margin-top: $sc-margin-lv1;

  @media (min-width: $screen-sm-min) {
    display: block;
  }

  i {
    font-size: 16px;
    letter-spacing: 2px;
  }
}

// Summary box
//
// The Summary Box is currently used across the platform in several contexts to display key information
// in a succinct manner facilitating the decision making process before performing an action.
//
// Markup:
// <div class="summary-container" style="width: 260px;">
//   <h3 class="summary-title">Order summary</h3>
//   <div class="summary-subtotal">
//     <p class="summary-grid-float">
//       <span>
//         Subtotal <span>1 item</span>
//       </span>
//       <span class="summary-grid-right">$100.00</span>
//     </p>
//   </div>
//   <div>
//     <p class="summary-grid-float">
//       Shipping <span class="summary-grid-right">$10.00</span>
//     </p>
//     <p class="summary-grid-float">
//       Tax <span class="summary-grid-right">$15.00</span>
//     </p>
//   </div>
//   <div class="summary-total">
//     <p class="summary-grid-float">
//       Estimated total <span class="summary-grid-right">$125.00</span>
//     </p>
//   </div>
// </div>
//
// Styleguide 3.7

.summary-title {
	font-weight: $sc-font-weight-light;
	font-size: $sc-font-size-xxxl;
	background: transparent;
	padding: 0 0 $sc-padding-lv2 0;
	margin-bottom: $sc-margin-lv2;
	border-bottom: 1px solid $sc-color-theme-border;
}

.summary-container {
	margin-bottom: 0;
	border: none;
	//box-shadow: 0 3px 0 $sc-color-theme-background;
	//-moz-box-shadow: 0 3px 0 $sc-color-theme-background;
	//-webkit-box-shadow: 0 3px 0 $sc-color-theme-background;
	border-bottom: 0;
	padding: 0;
}

.summary-subtotal {
	margin-bottom: $sc-margin-lv2;
	padding: $sc-padding-lv2 0 $sc-padding-lv4 0;
	font-weight: $sc-font-weight-light;
	font-size: $sc-font-size-xxl;
	border-bottom: 1px solid $sc-color-theme-border-light;
}

.summary-total {
	padding-bottom: 20px;
	border-bottom: 1px solid $sc-color-theme-border-light;
	font-size: $sc-font-size-xxl;
	font-weight: $sc-font-weight-light;
	text-transform: uppercase;

	& p {
		font-size: $sc-font-size-xxl;
		font-weight: $sc-font-weight-light;
	}
}

.summary-grid-right {
	float: right;
	padding-right: $sc-padding-lv3;
	font-weight: $sc-font-weight-semibold;
}

.summary-grid-float {
	//@extend .row;
	clear: both;
	margin-bottom: 0;
	font-size: $sc-font-size-l;
	font-weight: $sc-font-weight-light;
	padding-left: 0;
}

.summary-button-container {
	text-align: center;
	background: $sc-color-theme-background;
	padding: $sc-padding-lv4 0;
}

.button-proceed-to-checkout {
	@extend .button-primary;
	@extend .button-large;
}

.button-apply {
	@extend .button-secondary;
	@extend .button-small;
}

// Tabs
//
// Tabs are used in medium and large devices to divide content into different meaningful sections
// with a clear "tab" visual indicator of what section the user is currently viewing.
// Tabs resemble folder tabs. Users request the content they are interested in by clicking on the content corresponding to the tab.
// Tabs are only used for tablet and bigger screen sizes.
//
// Markup:
// <div role="tabpanel">
//   <ul class="content-tabs" role="tablist">
//     <li class="content-tabs-title active" role="presentation">
//       <a href="#"data-toggle="tab" data-target="#tab-1" aria-expanded="true">Tab 1</a>
//     </li>
//     <li class="content-tabs-title" role="presentation">
//       <a href="#"data-toggle="tab" data-target="#tab-2">Tab 2</a>
//     </li>
//   </ul>
//   <div class="tab-content"  data-action="tab-content">
//     <div role="tabpanel" class="tab-content-panel active" id="tab-1"">
//       <h3 class="tab-content-panel-title">Lorem Ipsum</h3>
//       <div class="tab-content-container">Content tab 1</div>
//     </div>
//     <div role="tabpanel" class="tab-content-panel" id="tab-2"">
//       <h3 class="tab-content-panel-title">Lorem Ipsum</h3>
//       <div class="tab-content-container">Content tab 2</div>
//     </div>
//   </div>
// </div>
//
// Styleguide 3.8

.content-tabs {
  display: none;
  margin-bottom: $sc-margin-lv3;

  @media (min-width: $screen-sm-min) {
    display: block;
  }
}

.content-tabs-title {
  &.active a, &:hover a {
    color: $sc-color-secondary;
    border-bottom: 2px solid $sc-color-theme-700;
  }

  &:only-child {
    display: none;
  }

  a {
    padding: $sc-padding-lv1 $sc-padding-lv3;
    //float: left;
    font-size: $sc-font-size-l;
    color: $sc-color-copy-light;
    border-bottom: 1px solid $sc-color-theme-300;
  }
}

.tab-content {
  clear: both;

  @media (min-width: $screen-sm-min) {
    padding: $sc-padding-lv3 0;
  }
}

.tab-content-panel {
  overflow: visible;
  @media (min-width: $screen-sm-min) {
    padding-bottom: 0;
    -webkit-transition: all 0.5s ease;
    -moz-transition: all 0.5s ease;
    -ms-transition: all 0.5s ease;
    -o-transition: all 0.5s ease;
    transition: all 0.5s ease;

    overflow: visible;

    opacity: 0;
    height: 0;

    &.active {
      opacity: 1;
      height: auto;
    }
  }
}

.tab-content-panel-title {
  margin-bottom: $sc-margin-lv4;
}

.tab-action {
  display: none;

  @media (min-width: $screen-sm-min) {
    display: block;
  }
}

.tab-action-more {
  margin-top: $sc-margin-lv2;
  display: block;
}

.tab-action-less {
  display: none;
  margin-top: $sc-margin-lv2;
}

