// Color palette
//
// Here you will find the main user interface color palette for the out of the box theme.
// Shades of orange, blue-grey, white and grey are used for backgrounds, boders, buttons and text all along the application.
//
// Styleguide 1.1

// Primary Color
//
// The Primary Color is used for primary actions and highlighted information.
//
// Colors:
// $sc-color-primary: #e23200
//
// Styleguide 1.1.2
$sc-color-primary: #000; /* editable({"type": "color", "label": "Highlight Color", "description": "Used mainly for 'call to action' elements such as 'Buy now' buttons an highlighted elements such as the Minicart Icon."}) */

// Secondary Color
//
// The Secondary Color is used for secondary actions. Different shades of this color are used for theme backgrounds, borders and text.
//
// Colors:
// $sc-color-secondary: #15607b
//
// Styleguide 1.1.3
$sc-color-secondary: #000; /* editable({"type": "color", "label": "Alternate Color", "description": "Used mainly for secondary action elements such as 'Subscribe to newsletter' buttons."}) */

// Neutral shades
//
// The neutral shade palette is a scale from 1000 (dark) to 0 (light).
// This theme defines a couple of medium scale values. The developer might find useful to add more intermetiate colors within the scale that might be referenced to this scale.
//
// Colors:
// $sc-neutral-shade: #4D5256 - All the neutral shade variables are calculated from $sc-neutral-shade variable. $sc-neutral-shade is equivalent to $sc-neutral-shade-500. Therefore $sc-neutral-shade variable names ending in values above 500 will be darker and those below 500 will be lighter.
// $sc-neutral-shade-700: #222426 - The darkest value on this scale is raraly used. It may be found on some texts or backgrounds.
// $sc-neutral-shade-500: #4D5256 - In occasions you will find this shade assigned to text but most of the times it will be the shade used for shadows.
// $sc-neutral-shade-300: #7E858B - This light shade is used exclusively used in texts.
// $sc-neutral-shade-0: #FFFFFF - The lightest value on this scale is largely used and may be usually found in texts, backgrounds and borders.
//
// Styleguide 1.1.4
$sc-neutral-shade: #000; /* editable({"type": "color", "label": "Neutral color", "description": "This is the base neutral shade color. In the case of the 'out of the box' theme #4D5256. If only this color is changed the rest of the neutral shade variants will be derived from this one using the preset theme shading definition: 700, 500, 300, 0."}) */
$sc-neutral-shade-700: #333; /* editable({"type": "color", "label": "Shade 700"}) */
$sc-neutral-shade-500: #555; /* editable({"type": "color", "label": "Shade 500"}) */
$sc-neutral-shade-300: #888; /* editable({"type": "color", "label": "Shade 300"}) */
$sc-neutral-shade-100: lighten($sc-neutral-shade, 50); /* editable({"type": "color", "label": "Shade 100"}) */
$sc-neutral-shade-0: #ccc; /* editable({"type": "color", "label": "Shade 0"}) */

// Theme Palette
//
// Just as the neutral shades palette, the Theme Palette is a scale from 1000 (dark) to 0 (light).
// This theme defines a couple of medium scale values. The developer might find useful to add more intermetiate colors within the scale that might be referenced to this scale.
//
// Colors:
// $sc-color-theme: #97CCDF - All the theme variables are calculated from $sc-color-theme variable. $sc-color-theme is equivalent to $sc-color-theme-500. Therefore $sc-color-theme variable names ending in values above 500 will be darker and those below 500 will be lighter.
// $sc-color-theme-900: #0E3E50 - Used mainly for headings
// $sc-color-theme-700: #16607B - new one
// $sc-color-theme-500: #97CCDF - Used mainly for general backgrounds (also referenced as $sc-color-theme-background)
// $sc-color-theme-300: #D2E8F0 - Used mainly for borders (also referenced as $sc-color-theme-border-light)
// $sc-color-theme-100: #F1F8FA - Used mainly for borders (also referenced as $sc-color-theme-border)
//
// Styleguide 1.1.5
$sc-color-theme: $sc-color-primary; /* editable({"type": "color", "label": "Theme color", "description": "This is the base theme color. If only this color is changed the rest of the theme color variants will be derived from this one using the preset theme shading definition: 900, 700, 500, 300, 100."}) */
$sc-color-theme-900: $sc-color-theme; /* editable({"type": "color", "label": "Shade 900"}) */
$sc-color-theme-700: #555; /* editable({"type": "color", "label": "Shade 700"}) */
$sc-color-theme-500: #888; /* editable({"type": "color", "label": "Shade 500"}) */
$sc-color-theme-300: #CCC; /* editable({"type": "color", "label": "Shade 300"}) */
$sc-color-theme-100: $sc-neutral-shade-300; /* editable({"type": "color", "label": "Shade 100"}) */

$sc-color-theme-border: $sc-color-theme; /* editable({"type": "color", "label": "Box border"}) */
$sc-color-theme-border-light: $sc-color-theme-100; /* editable({"type": "color", "label": "Box border light"}) */
$sc-color-theme-background: $sc-neutral-shade-0; /* editable({"type": "color", "label": "Box background"}) */
$sc-color-theme-content-background: #FFFFFF; /* editable({"type": "color", "label": "Alternative background color", "description": "Mainly used for box backgrounds within checkout and my account."}) */

// Messagging Palette
//
// The message box is defined by a colored text displayed over a colored background with an outline border.
// It might or may not include an icon in which case it should use the same color as the text.
// Possible message types are: Success, Warning, Error and Information.
// Each type is defined by a main color used for text. Background and border colors are calculated according to the main color.
//
// Colors:
// $sc-color-success: #097839 - Used for success messages
// $sc-color-success-border: #C5F3D9 - Used for success messages
// $sc-color-success-background: #E7FAEF - Used for success messages
// $sc-color-warning: #946A00 - Used for warning messages
// $sc-color-warning-border: #F4DC9F - Used for warning messages
// $sc-color-warning-background: #FFF6E1 - Used for warning messages
// $sc-color-error: #C01A29 - Used for error messages
// $sc-color-error-border: #F1CED1 - Used for error messages
// $sc-color-error-background: #FDF0F2 - Used for error messages
// $sc-color-info: #15607B - Used for information messages
// $sc-color-info-border: #D2E8F0 - Used for information messages
// $sc-color-info-background: #F1F8FA; - Used for information messages
//
// Styleguide 1.1.6
$sc-color-success: #43aac5;
$sc-color-success-background: rgba(255,255,255,.8);
$sc-color-success-border: #43aac5;

$sc-color-warning: #ffc47f;
$sc-color-warning-background: rgba(255,255,255,.8);
$sc-color-warning-border: #ffc47f;

$sc-color-error: #ef8880;
$sc-color-error-background: rgba(255,255,255,.8);
$sc-color-error-border: #ef8880;

$sc-color-info: #5573c8;
$sc-color-info-background: rgba(255,255,255,.8);
$sc-color-info-border: #5573c8;

// Links
//
// Links are used primarily as a navigational element. Links may also change what or how data is displayed (view more, show all). If the action taken by the user will change or manipulate data, use a button.
// Two different color variables are defined for this element
//
// Colors:
// $sc-color-link: #0067b9 - The color the link is written with. This color should ensure they look clickable.
// $sc-color-link-hover: #198FEC - The color with which links are hilighted when hovered.
// $sc-color-link-active: #0067B9
//
// Styleguide 1.1.7
$sc-color-link: $sc-neutral-shade; /* editable({"type": "color", "label": "Link"}) */
$sc-color-link-hover: $sc-neutral-shade-700; /* editable({"type": "color", "label": "Hover state"}) */
$sc-color-link-active: $sc-neutral-shade-500; /* editable({"type": "color", "label": "Active state"}) */

// Copy
//
// The out of the box theme uses only 3 different color shades when it comes to rendering text.
// The shades available are:
//
// Colors:
// $sc-color-copy-dark: #222426 - Used for almost every text on the site.
// $sc-color-copy: #4D5256 - Mainly used for values such as SKU
// $sc-color-copy-light: #7E858B - Used for labels
//
// Styleguide 1.1.8
$sc-color-copy-dark: $sc-neutral-shade; /* editable({"type": "color", "label": "Dark"}) */
$sc-color-copy: $sc-neutral-shade-700; /* editable({"type": "color", "label": "Text"}) */
$sc-color-copy-light: $sc-neutral-shade-500; /* editable({"type": "color", "label": "Light"}) */

// Font size variables
//
// A scale of sizes has been defined for its use along the different elements of the theme.
// As it happens with many other sizing scales variables go from XS to XXXL
// Every size is relative to a base font size that may be modified. In that case all the other sizes will change in relationship to this new base size.
// With the exception of this base font size expressed in pixels, font sizes are expressed in rem units.
//
// $sc-font-size-xxs - Double extra small font size
// $sc-font-size-xs - Extra small font size
// $sc-font-size-s - Small font size
// $sc-font-size-m - Medium font size
// $sc-font-size-l - Large font size
// $sc-font-size-xl - Extra large font size
// $sc-font-size-xxl - Double extra large font size
// $sc-font-size-xxxl - Triple extra large font size
// $sc-font-weight-light - Light font weight
// $sc-font-weight-normal - Normal font weight
// $sc-font-weight-semibold - Semibold font weight
// $sc-font-weight-bold - Bold font weight
//
// Styleguide 1.2
$sc-font-size-base: 15px;
$sc-font-size-xxs: 0.75rem;
$sc-font-size-xs: 0.87rem;
$sc-font-size-s: 0.93rem;
$sc-font-size-m: 1rem;
$sc-font-size-l: 1.067rem;
$sc-font-size-xl: 1.2rem;
$sc-font-size-xxl: 1.47rem;
$sc-font-size-xxxl: 1.73rem;

