.skip-to-main-content {
  left: 50%;
  padding: $sc-padding-lv2;
  position: absolute;
  transform: translateY(-100%);
  transition: transform 0.1s;
  opacity: 0;
  z-index: 1;
  color: black;
  background: white;
  pointer-events: none;

  &:focus-visible,
  &:focus {
    transform: translateY(0%);
    opacity: 1;
    pointer-events: auto;
  }
}
